import React, { Component } from 'react';

import "../../Containers/DashBoard/DashStyle.css"; // Import your CSS file
// import { Toffle } from '../sidebar/SidebarComponent';

class Nav extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isSidebarHidden: false
    };
  }

  componentDidMount() {
    const sidebar = document.getElementById('sidebar');
    sidebar.addEventListener('mouseleave', this.handleMouseLeave);
    sidebar.addEventListener('mouseenter', this.handleMouseEnter);
  }

  componentWillUnmount() {
    const sidebar = document.getElementById('sidebar');
    sidebar.removeEventListener('mouseleave', this.handleMouseLeave);
    sidebar.removeEventListener('mouseenter', this.handleMouseEnter);
  }

  handleDropdownClick = (e) => {
    e.preventDefault();
    const allDropdowns = document.querySelectorAll('#sidebar .side-dropdown');

    if (!e.target.classList.contains('active')) {
      allDropdowns.forEach(i => {
        const aLink = i.parentElement.querySelector('a:first-child');

        aLink.classList.remove('active');
        i.classList.remove('show');
      });
    }

    e.target.classList.toggle('active');
    e.target.nextElementSibling.classList.toggle('show');
  };

  toggleSidebar = (e) => {
    const allSideDivider = document.querySelectorAll('#sidebar .divider');
    const sidebar = document.getElementById('sidebar');

    if (sidebar.classList.contains('hide')) {
      allSideDivider.forEach(item => {
        item.textContent = '-';
      });
      const allDropdowns = document.querySelectorAll('#sidebar .side-dropdown');
      allDropdowns.forEach(item => {
        const a = item.parentElement.querySelector('a:first-child');
        a.classList.remove('active');
        item.classList.remove('show');
      });
    } else {
      allSideDivider.forEach(item => {
        item.textContent = item.dataset.text;
      });
    }

    sidebar.classList.toggle('hide');
  };

  handleMouseLeave = () => {
    if (this.state.isSidebarHidden) {
      const allDropdowns = document.querySelectorAll('#sidebar .side-dropdown');
      const allSideDivider = document.querySelectorAll('#sidebar .divider');
      allDropdowns.forEach(item => {
        const a = item.parentElement.querySelector('a:first-child');
        a.classList.remove('active');
        item.classList.remove('show');
      });
      allSideDivider.forEach(item => {
        item.textContent = '-';
      });
    }
  };

  handleMouseEnter = () => {
    if (this.state.isSidebarHidden) {
      const allDropdowns = document.querySelectorAll('#sidebar .side-dropdown');
      const allSideDivider = document.querySelectorAll('#sidebar .divider');
      allDropdowns.forEach(item => {
        const a = item.parentElement.querySelector('a:first-child');
        a.classList.remove('active');
        item.classList.remove('show');
      });
      allSideDivider.forEach(item => {
        item.textContent = item.dataset.text;
      });
    }
  };

  handleSidebarToggle = () => {
    this.setState(prevState => ({
      isSidebarHidden: !prevState.isSidebarHidden
    }));
  };


  render() {
    return (
      <div className='container'>
        {/* NAVBAR */}
        <nav>
          <i><svg xmlns="http://www.w3.org/2000/svg" width="46" height="46" fill="currentColor" className="bi bi-ev-front-fill" viewBox="0 0 16 16">
              <path d="M2.52 3.515A2.5 2.5 0 0 1 4.82 2h6.362c1 0 1.904.596 2.298 1.515l.792 1.848c.075.175.21.319.38.404.5.25.855.715.965 1.262l.335 1.679c.033.161.049.325.049.49v.413c0 .814-.39 1.543-1 1.997V13.5a.5.5 0 0 1-.5.5h-2a.5.5 0 0 1-.5-.5v-1.338c-1.292.048-2.745.088-4 .088s-2.708-.04-4-.088V13.5a.5.5 0 0 1-.5.5h-2a.5.5 0 0 1-.5-.5v-1.892c-.61-.454-1-1.183-1-1.997v-.413a2.5 2.5 0 0 1 .049-.49l.335-1.68c.11-.546.465-1.012.964-1.261a.807.807 0 0 0 .381-.404l.792-1.848Zm6.75.51a.186.186 0 0 0-.23.034L6.05 7.246a.188.188 0 0 0 .137.316h1.241l-.673 2.195a.188.188 0 0 0 .085.218c.075.043.17.03.23-.034l2.88-3.187a.188.188 0 0 0-.137-.316H8.572l.782-2.195a.188.188 0 0 0-.085-.218Z" />
             </svg></i> &nbsp;Drivers

          <form action="##">
            <div className="form-group">
              <input type="text" placeholder="Search..." />
              <i className='bx bx-search icon' ></i>
            </div>
          </form>
          <a href="##" className="nav-link">
            <i className='bx bxs-bell icon' ></i>
            <span className="badge">5</span>
          </a>
          <a href="##" className="nav-link">
            <i className='bx bxs-message-square-dots icon' ></i>
            <span className="badge">8</span>
          </a>
        </nav>
        {/* NAVBAR */}
      </div>
    );
  }
}

export default Nav;
